// SPDX-License-Identifier: UNLICENSED

pragma solidity >=0.5.0 <0.9.0;

import '@openzeppelin/contracts/utils/math/SafeMath.sol';


contract ReentrancyGuard {
  using SafeMath for uint256;

  event LogDeposit(address indexed sender, uint amount);


  mapping(address => uint256) private timeEnabled;
  mapping(address => uint256) public sales;

  modifier rateLimiter(uint _time) {
    require(timeEnabled[msg.sender].add(_time) < block.timestamp);
    timeEnabled[msg.sender] = block.timestamp;
    _;
  }


  function deposit(uint _amount) external payable {
    require(_amount > 0, 'deposit cannot be 0');
    sales[msg.sender] = sales[msg.sender].add(_amount);
    emit LogDeposit(msg.sender, _amount);
  }



  function getBal() public view returns(uint) {
    return address(this).balance;
  }

}
